package ra.dev;public class CatalogDTO {    private Integer catalogId;    private String catalogName;    private Boolean catalogStatus;    public Integer getCatalogId() {        return this.catalogId;    }    public void setCatalogId(Integer catalogId) {        this.catalogId = catalogId;    }    public String getCatalogName() {        return this.catalogName;    }    public void setCatalogName(String catalogName) {        this.catalogName = catalogName;    }    public Boolean getCatalogStatus() {        return this.catalogStatus;    }    public void setCatalogStatus(Boolean catalogStatus) {        this.catalogStatus = catalogStatus;    }}